  return (
    <>
      <div className="modal modal-3">
        <h3>Step3</h3>
        <div className="mt8"></div>
        <div className="explain">
          <h2>絵を生成する</h2>
          <p className="mt8 fs12">これらの画像が選ばれました</p>
        </div>
        <SelectedImgs />
      </div>
      <div>
        <img src={backImg} alt="" />
      </div>
    </>
  );
}

export default Modal3;
